import React from 'react';
import './Footer.css';

export default class Footer extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return(
      <div>
        <footer>
          <p>Laundry Informational Technologies, Copyright &copy; 2018</p>
        </footer>
      </div>
    )
  }
}
